import React from 'react';
import { Button, TextField, Dialog, DialogActions } from '@material-ui/core';

export default function FormContent(){
    return (
        <form>
            <TextField
                            autoFocus
                            margin="dense"
                            id="name"
                            label="Email Address"
                            type="email"
                            fullWidth
                        />
        </form>
    );
}
